    across geothermal systems; scope of paper; effective mobilities of cations and anions
    in electrolytic solutions; mathematical calculations describing electrochemical
    concentrations; equations used to describe flux of solute ions and total electric
    current; pure ambipolar diffusion equations and potential gradient equation; equations
    describing electrical effects generated by the diffusion of ions and the divergence
